module_princess.princessList:
    path: '/princessList'
    defaults:
     _controller: '\Drupal\module_princess\Controller\PrincessController::princessList'
     _title: 'disney princess list'
    requirements:
      _permission: 'access content'
          
module_princess.princessform:
    path: '/princess-form'
    defaults:
     _form: '\Drupal\module_princess\Form\PrincessForm'
     _title: 'Who wil Win form'
    requirements:
      _permission: 'access content'